import { useState } from "react";
import "./AfterPatientLoginBlock.css";
import Profile from "./PatientBlock/Profile"

const AfterPatientLoginBlock = () => { 

  const [profile , setProfile]=useState("");
  const [appointment , setAppointment]=useState("");
  const [history , setHistory]=useState("");
  const [logOut , setLogOut]=useState("");

  function Profil(){
    setProfile(<Profile/>);
  }
  function Appoint(){
    setAppointment(<Profile/>);
  }
  function History(){
    setHistory(<Profile/>);
  }
  function Logout(){
    setLogOut(<Profile/>);
  }
  
  return (
    <div className="AfterLoginBlockMain">
      <div className="LHSBlock">
        <div>
        <div>
            <button type="button" onClick={Profil} className="btn btn-light Btn-Custom-Size ">
              Profile
            </button>
          </div>
          <div>
            <button type="button" onClick={Appoint} className="btn btn-light Btn-Custom-Size">
              Appointment
            </button>
          </div>
          <div>
            <button type="button" onClick={History} className="btn btn-light Btn-Custom-Size">
              Booking History
            </button>
          </div>
          <div>
            <button type="button" onClick={Logout} className="btn btn-light Btn-Custom-Size">
              LogOut
            </button>
          </div>
        </div>
      </div>
      <div className="RHSBlock">
        {profile}        
      </div>
    </div>
  );
};

export default AfterPatientLoginBlock;
